import sys


def get_input():
    n, q = [int(x) for x in sys.stdin.readline().split()]
    return n, q[:-1]


def check_permutation(n, q):
    if len(q) != n - 1:
        return False
    if n == 1:
        return True
    for i in q:
        if abs(i) >= n:
            return False
    return True


def create_permutation(n, q):
    if n == 1:
        return [1]
    p = [0] * n
    p[0] = q[0]
    p[1] = q[0] + q[1]
    for i in range(2, n):
        p[i] = p[i-1] + q[i-1]
    return p


def print_permutation(p):
    print(" ".join([str(x) for x in p]))


def main():
    n, q = get_input()
    if not check_permutation(n, q):
        print(-1)
        return
    p = create_permutation(n, q)
    print_permutation(p)


if __name__ == "__main__":
    main()


